                <button type="button" class="btn btn-outline-secondary">Denim</button>
                <button type="button" class="btn btn-outline-secondary">Sweatshirts</button>
                <button type="button" class="btn btn-outline-secondary">Polo Tees</button>
                <button type="button" class="btn btn-outline-secondary">Shirt</button>
            </div>
        </React.Fragment>
    )
};

export default Filter;
